unsafeWindow.doAutoNvpNodeHtml=function(htm){
	var nodes = htm.split('"')
	var resultParr = new Array();
	var lastName = '';
	for( x in nodes ){
		
		if( x % 2 == 0 ){
			lastName=nodes[x].replace(' ','').replace('=','');
		}else{
			resultParr[lastName] = nodes[x];
		}
	}
	return resultParr;
}

